import React from 'react';
import './Highlights.css';

const Highlights = () => {
  return (
    <div className="highlights-section">
      <h2 className="blinking-text">Best Hygiene & Health Standards</h2>
      <div className="bouncing-badge">Next Day Fresh Delivery</div>
      <h2 className="glow-text">Halal Certified Quality</h2>
      <span className="pulsing-tag">100% Refund Guarantee</span>
    </div>
  );
};

export default Highlights;
